                {
                    urlWeb:{url:'', img:iconWeb},
                    idDrive:{url:'', img:iconDrive},
                    urlDescarga:{url:'', img:iconDescarga},
                }
    },
    visorList: [
        {
            urlID:[''],
            typeMedia:[''],
            titulo:[''],
            artista:[''],
            tag:[''],
            img:[''],
            sliderImg:[''],
            icon:[''],
            categoria:[''],
            boton1:[''],
            info:['']
