    ],
    nextVisor:[
        {
            urlID:[''],
            typeMedia:[''],
            titulo:[''],
            artista:[''],
            tag:[''],
            img:[''],
            sliderImg:[''],
            icon:[''],
            categoria:[''],
            boton1:[''],
            info:['']
        }
    ],
    infoDetailViewer: [],
    listaCategorias: [],

/*------------Filter&Search------------*/
    filteredMedia: [],
    searchedMedia: [],
    mediaFound: {},

/*--------------Pagination--------------*/
  


}

export default function rootReducer(state = initialState, action){
    switch (action.type){
/*----------------Auth----------------*/
        case OPTION:
            return{
                ...state,
                option: action.payload
            }
        case RESET_OPTION:
            return{
                ...state,
                option: ""
            }
        case LOGGED_ACCOUNT:
            console.log(action.pathname);
            return{
                ...state,
                loggedAccount: action.payload.at(1),
                currentUser: action.payload.at(1)? action.payload.at(0).alias : '',
                userState: action.payload.at(1)? "online":"offline",
                redirect: action.payload.at(1)? (action.pathname? action.pathname : "/browser"):"/"

            }
        case GET_USERS:
            return{
                ...state,
                userList: action.payload.map(e=>{return e.alias}),    
            }
        case LOG_IN:
            return{
                ...state,
                currentUser: action.payload.current,
                userState: action.payload.state? "online":"offline",
                redirect: action.payload.state? "/browser":"/",
                loggedAccount: action.state,
            }
        case LOG_OUT:
            return{
                ...state,
                currentUser: action.payload.current,
                redirect: action.payload.state? "/browser":"/",
                userState: action.payload.state? "online":"offline",
                nextVisor:[            
                    {
                        urlID:[''],
                        typeMedia:[''],
                        titulo:[''],
                        artista:[''],
                        tag:[''],
                        img:[''],
                        sliderImg:[''],
                        icon:[''],
                        categoria:[''],
                        boton1:[''],
                        info:['']
