                        urlID:[''],
                        typeMedia:[''],
                        titulo:[''],
                        artista:[''],
                        tag:[''],
                        img:[''],
                        sliderImg:[''],
                        icon:[''],
                        categoria:[''],
                        boton1:[''],
                        info:['']
                    }
                ],
            }
/*----------------Media----------------*/
        case GET_POSTS:
            return{
                ...state,
                visorList: action.payload,
                nextVisor: action.payload
            }
        case GET_INFO:
            return{
                ...state,
                infoDetailViewer: action.payload.at(0)
            }
        case GET_MEDIATYPE:
            return{
            ...state,
            }
        case GET_CATEGORIAS:
