                listaCategorias: [...new Set([...state.listaCategorias, ...new Set(action.payload)].filter(e=> e !== ''))]
            }
        case RESET_MEDIA:
            return{
                ...state,
                infoDetailViewer: action.payload
            }
        case NEXT_VISOR:
