                ...state,
                nextVisor: [state.visorList[action.payload]]
            }
        case RESET_VISOR:
            return{
                ...state,
                nextVisor:[            
                    {
                        urlID:[''],
                        typeMedia:[''],
                        titulo:[''],
                        artista:[''],
                        tag:[''],
                        img:[''],
                        sliderImg:[''],
                        icon:[''],
                        categoria:[''],
                        boton1:[''],
                        info:['']
                    }
                ],
            }
        default:
            return {...state}
    }
}
